// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./SyndicateOwnerLogic.sol";

/// @notice Stores contract/address pairs of deployed Syndicate
/// contracts.
contract SyndicateIntegrationsCoordinatorLogicV0 is SyndicateOwnerLogic {
    /// @dev Currently we store the data inside the logic contract.
    /// Once we feel comfortable with what data is needed by outside
    /// parties we will split this into separate contracts.
    mapping(bytes32 => address) private contractAddress;

    constructor() SyndicateOwnerLogic() {}

    /// @notice Computes and returns the hash of provided string for use in
    /// functions that only accept hashed strings as parameters
    /// @param toHash String to hash
    /// @return hashed The hash of the string
    function hash(string calldata toHash) public pure returns (bytes32 hashed) {
        return keccak256(abi.encodePacked(toHash));
    }

    /// @notice Getter for the address that a contract is deployed at
    /// @param contractHash The hashed contract name
    /// @return _address The address where the contract is deployed
    function getAddress(bytes32 contractHash)
        public
        view
        returns (address _address)
    {
        require(contractAddress[contractHash] != address(0), "NO_SUCH_CONTRACT");
        return (contractAddress[contractHash]);
    }

    /// @notice Add or update contract/address pairs.
    /// @param hashes The hashed contract names
    /// @param addresses The addresses of the contracts
    function upsertContracts(
        bytes32[] calldata hashes,
        address[] calldata addresses
    ) public onlyOwner {
        // Both passed-in arrays must have the same length
        require(hashes.length == addresses.length, "ARRAY_LENGTHS_DIFFER");
        for (uint256 i = 0; i < hashes.length; i++) {
            contractAddress[hashes[i]] = addresses[i];
        }
    }

    /// @notice Remove a contract
    /// @param _hash The hashed contract name
    function removeContract(bytes32 _hash) public onlyOwner {
        require(contractAddress[_hash] != address(0), "NO_SUCH_CONTRACT");
        contractAddress[_hash] = address(0);
    }
}

